import logo from './logo.svg';
import './App.css';
import BookShelf from './Bookshelf';
import Header from './Header';
import Search from './Search';
import Button from './Button';
import Library from './Library';
import { Route } from 'react-router';
import Aux from './Aux';


function App() {
  return (
    <div className="App">
      <Route
      exact
      path='/store'
      render={()=>(
        <Library/>
      )}/>
       <Route
      exact
      path='/'
      render={()=>(
        <Aux>
        <Header/>
        <BookShelf/>
    <Button/>
    </Aux>
      )}/>






    </div>
  );
}

export default App;
